import React from "react";
import Navbar from "./Navbar";
import "./LandingHomePage.css";

const Header = () => {
  return (
    <>
      <div className="headerContainer">
        <Navbar />
        <div className="headerContainer">
          <Container fluid>
            <Row>
              <Col md={6} className="headerDefinitionLeft">
                <h2>/We-ra</h2>
                <h3>[wera]</h3>
              </Col>
              <Col md={6} className="headerDefinitionRight">
                <p className="headerDefinitionText">
                  a.k.a /mboka/ is a Kenyan slang meaning work. Commonly
                  associated with the youth and some native communities.
                </p>
              </Col>
            </Row>
          </Container>
        </div>

        {/* <div className="image-container">
        <img src="https://business.uonbi.ac.ke/sites/default/files/2020-11/job.jpg" alt="Header Image" />
      </div> */}
      </div>
    </>
  );
};

export default Header;
